post:
  tags:
    - default
  summary: >-
    https://api.theknowable.com/projects/7bce747b-1139-478e-a5a9-b77ad7492e22/overlay
  requestBody:
    content:
      multipart/form-data:
        schema:
          type: object
          properties:
            file:
              type: string
              format: binary
  parameters:
    - name: Content-Type
      in: header
      schema:
        type: string
      example: application/json
    - name: Cookie
      in: header
      schema:
        type: string
      example: >-
        user=eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9..yXG6J6yo7zcz54nKnF6_5itxSHfDWTNyEVQ6RIGYi6I
    - name: Cache-Control
      in: header
      schema:
        type: string
      example: no-cache
  responses:
    '200':
      description: Successful response
      content:
        application/json: {}
